import React, { useEffect, useState, useRef } from 'react';
import './signin.css';
import Google from './googleOAuth';
import { ButtonPopRight } from '../../buttons';
function SignIn() {
    console.log("again")
    const [contract1, setcontract1] = useState(true)
    const [contract2, setcontract2] = useState(true)
    const [contract3, setcontract3] = useState(true)
    const googleRef = useRef(null)
    const guestRef = useRef(null)
    const emailRef = useRef(null)
    useEffect(() => {
        googleRef.current.addEventListener("mouseenter", (() => { setcontract1(false) }))
        googleRef.current.addEventListener("mouseleave", (() => { setcontract1(true) }))
        guestRef.current.addEventListener("mouseenter", (() => { setcontract2(false) }))
        guestRef.current.addEventListener("mouseleave", (() => { setcontract2(true) }))
        emailRef.current.addEventListener("mouseenter", (() => { setcontract3(false) }))
        emailRef.current.addEventListener("mouseleave", (() => { setcontract3(true) }))
    }, [])

    return (
        <div className="signinWrapperWrapper">
            <div className="signinWrapper">
                <div className="signInBox">
                </div>
            </div>
        </div>
    )
}

export default SignIn
